const React = require('react');
class Default extends React.Component {
    render() {
        return (
            <html>
                <head>
                    //=====Meta Tags For Responsive Layout===//
                    <meta charset="utf-8"></meta>  
                    <meta name="viewport" content="width=device-width, initial-scale=1, shrink-to-fit=no"></meta>
                    //======Bootstrap Style sheet link before your style sheet not sure why but important====/// 
                    <link rel="stylesheet" href="https://stackpath.bootstrapcdn.com/bootstrap/4.5.2/css/bootstrap.min.css" integrity="sha384-JcKb8q3iqJ61gNV9KGb8thSsNjpSL0n8PARn9HuZOnIxN0hoP+VmmDGMN5t9UJ0Z" crossorigin="anonymous"></link>
                    //====your linked style sheet (regualr css)=====//
                    <link rel="stylesheet" href="/css/style.css" />
                    //==========JS, Popper.js, and jQuery needed to run boostrap at full copassity with all its lib and functions====// 
                    <script src="https://code.jquery.com/jquery-3.5.1.slim.min.js" integrity="sha384-DfXdz2htPH0lsSSs5nCTpuj/zy4C+OGpamoFVy38MVBnE+IbbVYUew+OrCXaRkfj" crossorigin="anonymous"></script>
                    <script src="https://cdn.jsdelivr.net/npm/popper.js@1.16.1/dist/umd/popper.min.js" integrity="sha384-9/reFTGAW83EW2RDu2S0VKaIzap3H66lZH81PoYlFhbGU+6BZp6G7niu735Sk7lN" crossorigin="anonymous"></script>
                    <script src="https://stackpath.bootstrapcdn.com/bootstrap/4.5.2/js/bootstrap.min.js" integrity="sha384-B4gt1jrGC7Jh4AgTPSdUtOBvfO8shuf57BaghqFfPlYxofvL8/KUEfYiJOMMV+rV" crossorigin="anonymous"></script>
                    <title> Yank Bootstrap Example</title>
                </head>
                <body> 
                    <nav>
                        <li><a href="/Index">Index</a></li>
                        <li><a href="/New">Create New</a></li>

                    </nav>
                    {this.props.children}
                    <footer>
                        <h4>Created By Yank</h4>
                    </footer>
                </body>
            </html>
        )
    }
}
module.exports = Default;
